import React, { useState } from "react";
const Index = () => {
  const [num, setNum] = useState(1);
  return (
    <div>
      <h1>{num}</h1>
      <button>+2</button>
      <button>*5</button>
      <button>-1</button>
      <button>+8</button>
    </div>
  );
};
export default Index;
